    Pre-General adn Post-General report have been amended to include employees who
    worked more than 25% of their time in connection with federal elections.5) These
    expenditures were not Federal Election Activity and not on behalf of any federal
    candidate; 6) Expenses for fundraising and fundraising events were not on behalf
    of any federal candidate; 7) Payments for salary on Schedule H4 were for employees
    who worked less than 25% of their time on federal elections; 8) Payments for direct
    mail on Schedule H4 were neither a federal election activity nor on behalf of
    any federal candidate; 9) Payments for voter file maintenance were neither federal
    election activity or on behalf of any federal candidate; 10) Payments for 'mailing'
    were not FEA or on behalf of any federal candidate; 11) This error has been corrected;
